1) le  jugement contradictoire numéro 11 du 31 juillet 2015 par la chambre de droit de propriété foncière du tribunal d'Abomey-Calavi ;

2) l'arrêt contradictoire numéro 099/2019 du 19 novembre 2019 rendus par la cour d'appel de Cotonou en sa deuxième Chambre civile de droit de propriété foncière ;

